BASE_URL = 'https://bulbapedia.bulbagarden.net/wiki/File:'

def getPokemonNames():
    pokemonNames=[]
    for i in range(1, 9):
        url = "https://pokeapi.co/api/v2/generation/" + str(i) + "/"
        r = requests.get(url)
        data = r.json()
        for i in data['pokemon_species']:
            pokemonNames.append(i['name'].capitalize())
    return pokemonNames

def getPokemonIds():
    pokemonIds=[]
    for i in range(1, 9):
        url = "https://pokeapi.co/api/v2/generation/" + str(i) + "/"
        r = requests.get(url)
        data = r.json()
        for i in data['pokemon_species']:
            url = i['url']
            pat = r'/pokemon-species/(\d+)/'       
            match = re.search(pat, url)
            id = match.group(1).zfill(3)
            pokemonIds.append(id)
    return pokemonIds

def generateUrl(pokemonName, pokemonId):
    file_name = pokemonId + pokemonName + ".png"
    url = BASE_URL + file_name
    return url

def testUrl(url, idx = 0):
    page = requests.get(url)
    if(page.status_code==200):
        print(str(idx) + " / 905")
        success.append(url)
        return True
    else:
        print()
        print('ERROR' + str(page.status_code) + ': ' + str(idx) + ' ' + url)
        exeption.append(url)
        return False
    
def getImgUrl(url):
    req = requests.get(url)
    if req.status_code == 503:
        time.sleep(30)
        getImgUrl(url)
    soup = BeautifulSoup(req.content, 'html.parser')
    res=soup.find(class_='fullMedia').find(class_="internal")
    url = "https:"+res['href']
    return url

def saveImg(folderPath, url, idx):
    r = requests.get(url, stream=True)
    while r.status_code == 503:
        time.sleep(5)
        r = requests.get(url, stream=True)
        print('while')

    print(r.status_code)
    if not r.status_code == 200:
        exeption.append(url)
    with open(folderPath,'wb') as file:
        for chunk in r.iter_content(chunk_size=1024):
          if chunk: 
             file.write(chunk)
        print(str(idx) + '/ 905 ' + url)


    

    
