for i in range(1,20):
    if not os.path.exists('./Result/' + str(i)):
        os.makedirs('./Result/' + str(i))


folder_number = 1
index = 1
idx = 0

for img in imgUrl:
    if index > 50:
        index = 1
        folder_number = folder_number + 1

    name = './Result/' + str(folder_number) + '/' + pokemonName[idx] + '.png'
    saveImg(name, img, idx)
    index = index + 1
    idx = idx + 1